import clsx from "clsx";
import React from "react";

interface Props {
  className?: string;
  loading?: "lazy" | "eager";
  priority?: "auto" | "high" | "low";
}

export const Logo = (props: Props) => {
  const { loading: loadingFromProps, priority: priorityFromProps, className } = props;

  const loading = loadingFromProps || "lazy";
  const priority = priorityFromProps || "low";

  return (
    /* eslint-disable @next/next/no-img-element */
    <>
      <img
        alt="Payload Logo"
        width={203}
        height={64}
        loading={loading}
        fetchPriority={priority}
        decoding="async"
        className={clsx("h-16 w-full max-w-[12.6875rem] dark:hidden", className)}
        src="data:image/png;base64,"
      />
      <img
        alt="Payload Logo"
        width={203}
        height={64}
        loading={loading}
        fetchPriority={priority}
        decoding="async"
        className={clsx("hidden h-16 w-full max-w-[12.6875rem] dark:block", className)}
        src="https://situ.systems/images/img/ciexpomel24/darklogo.png"
      />
    </>
  );
};
